package com.caronte.json;

import java.io.IOException;

import com.caronte.automaton.State;
import com.caronte.automaton.TransitionTable;

public class JSON
{
	private static TransitionTable transitionTable;	
	
	public static JSONObject parse(String string) throws Exception
	{
		return parse(1, string);
	}

	private static JSONObject parse(Integer line, String string) throws IOException, Exception
	{
		State state;
		Boolean flag = true;
		JSONObject jsonObject = null;

		if (transitionTable == null)
		{
			transitionTable = new TransitionTable();
			flag = transitionTable.loadFromBase64Input("");
			// flag = transitionTable.loadFromBase64Input("");
		}
		
		if (flag)
		{
			state = transitionTable.getFirstState();			

			ParserParameter parameter = new ParserParameter(string.toCharArray());

			jsonObject = new JSONObject();
			JSONActionExecutor actionExecutor = new JSONActionExecutor(line, jsonObject, parameter);
			
			while (parameter.hasNext()) 
			{
				char c = parameter.getNext();
				
				if (((int)c) == 65279)
				{
					continue;					
				}

				state = transitionTable.nextState(state, Character.toString(c), actionExecutor);

				if (state == null)
				{
					String error;
					String fragment = actionExecutor.getLineFragment();
					
					fragment = fragment.replaceAll("\t", "    ");
					
					if (fragment.length() > 50)
					{
						fragment = "... " + fragment.substring(fragment.length() - 50);
					}
					
					error = "Parse error on line " + actionExecutor.getLineNumber() + ":\n\n" + fragment + "\n";
					for (int ie = 1; ie < fragment.length(); error +="-", ie++);
					error += "^\n";
					for (int ie = 10; ie < fragment.length(); error +=" ", ie++);
					error += "Unexpected character\n";
					throw new Exception(error);
				}
			}						
		}
		
		return jsonObject;
	}
}
